import styled from 'styled-components';

const Border = styled.div`
overflow: hidden;
background: transparent;
position: absolute;
right: 0;
width: 38%;
height:20%;
bottom: 30%;
border: 2px solid blue;
`

const MiniGraph = () => {
    return (
        <Border></Border>
    )
}

export default MiniGraph
